export const CheckMark = () => {
  return (
    <div>
      <h1>Completed</h1>
      <style jsx>{`
        h1 {
          font-size: 35px;
          color: white;
        }
      `}</style>
    </div>
  );
};

export const Close = () => {
  return (
    <div>
      <h1></h1>
    </div>
  );
};
